<script setup>

import gsap from 'gsap'

const emit = defineEmits(['timelines'])

const props = defineProps({
    reverse: {
        type: Boolean,
        default: false
    }
})

let logoTL, blinkingTL

const prepareTimelines = () => {
    const dashValues = [40, 100, 60, 125, 40, 360, 25, 260, 125]
    const styleChars = document.querySelectorAll('#style-group > g > g > *')
    const that = document.querySelector('#that')
    const compChars = document.querySelectorAll('#compiles > *')
    const dash = document.querySelector('#dash')
    
    //define timelines
    blinkingTL = gsap.timeline({paused: true })
    logoTL = gsap.timeline({
        paused: true, 
        onComplete: () => {
            gsap.timeline().add(blinkingTL.restart().play())
        }
    })
    

    //dynamically fill up the dasharrays with predefined values
    styleChars.forEach((char, i) => {
        gsap.set(char, {
            strokeDasharray: dashValues[i],
            strokeDashoffset: dashValues[i]
        })

        logoTL.to(char, {
                duration: dashValues[i] / 1000,
                strokeDashoffset: 0
                },
                i === 6 ? ">-15%" : ">-30%"
            )
        })

        gsap.set(that, { opacity: 0 })
        gsap.set(compChars, { opacity: 0 })
        gsap.set(dash, { opacity: 0 })

        logoTL.to(that, {
                duration: 0.5,
                opacity: 1
            },
            ">-30%"
        )

        logoTL.to(compChars, {
            opacity: 1,
            stagger: 0.05
        })

        blinkingTL
            .to(dash, { duration: 1, opacity: 1, repeat: -1 })
            //.to('#compiles', { duration: 1, opacity: .5, repeat: -1, yoyo: true })
}

onMounted(() => {
    prepareTimelines()
    emit('timelines', [logoTL, blinkingTL])
})

</script>